sys_hub_input_scripts.script:
{"coordinate_y":{"scriptActive":true,"script":"/*
**Access Flow/Action data using the fd_data object. Script must return a value. 
**Order number is offset by +1 in Error Handling Section.
**Available options display upon pressing "." after fd_data
**example: var shortDesc = fd_data.trigger.current.short_description;
**return shortDesc;
*/

let direction = fd_data.subflow_inputs.game_command.direction.toString();
let head_x = fd_data.subflow_inputs.game_command.coordinate_x * 1;
let head_y = fd_data.subflow_inputs.game_command.coordinate_y * 1;
let offset_x = fd_data._3__for_each.item.offset_x * 1;
let offset_y = fd_data._3__for_each.item.offset_y * 1;

if (direction == 'Down') {
 return head_y + offset_y;
}
else if (direction == 'Up') {
 return head_y - offset_y;
}
else if (direction == 'Right') {
 return head_y - offset_x;
}
else if (direction == 'Left') {
 return head_x + offset_x;
}"}}

